INSERT INTO `table_static` (`id`, `photo`, `thumb`, `link`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `link_video`, `taptin`, `type`, `hienthi`) VALUES
(1, 'gallery-12-8574.jpg', 'gallery-12-8574_75x50.jpg', 'https://www.facebook.com/', 'gioi-thieu', 'about-us', '&lt;p&gt;Plimsolls were popularly used by far riders and later also began to be used by tennis and croquet athletes for their comfort. Special soles and motifs were engraved below to increase the surface friction of the developed shoes, and gradually they were widely used for the British army. The shoe was also gradually used more for daily commuting and in outdoor activities in the 20th century, plimsolls were even discovered along with the body of the ill-fated Terra Nova expedition. Plimsolls is even a mandatory shoe in the British gym class. [Citation needed]&lt;/p&gt;\r\n', '&lt;p&gt;Ban đầu những đ&amp;ocirc;i gi&amp;agrave;y n&amp;agrave;y được gọi với c&amp;aacute;i t&amp;ecirc;n &amp;#39;plimsoll&amp;#39; v&amp;agrave;o thập ni&amp;ecirc;n 1870, xuất hiện trong cuốn s&amp;aacute;ch&amp;nbsp;The Plimsoll Sensation&amp;nbsp;của Nicholette Jones.&lt;a href=&quot;\\&quot;&gt;[7]&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Plimsolls được sử dụng phổ biến bởi những người đi chơi xa v&amp;agrave; sau đ&amp;oacute; cũng bắt đầu được sử dụng bởi c&amp;aacute;c vận động vi&amp;ecirc;n m&amp;ocirc;n&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;tennis&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;croquet&lt;/a&gt;&amp;nbsp;v&amp;igrave; sự thoải m&amp;aacute;i của ch&amp;uacute;ng. Phần đế đặc biệt c&amp;ugrave;ng hoạt tiết được khắc ch&amp;igrave;m b&amp;ecirc;n dưới để gia tăng ma s&amp;aacute;t bề mặt của những đ&amp;ocirc;i gi&amp;agrave;y đựoc ph&amp;aacute;t triển, v&amp;agrave; dần dần ch&amp;uacute;ng cũng được d&amp;ugrave;ng rộng r&amp;atilde;i cho&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;qu&amp;acirc;n đội Anh&lt;/a&gt;. Loại gi&amp;agrave;y cũng dần dần được sử dụng nhiều hơn cho những c&amp;ocirc;ng việc đi lại h&amp;agrave;ng ng&amp;agrave;y v&amp;agrave; trong c&amp;aacute;c hoạt động ngo&amp;agrave;i trời v&amp;agrave;o thế kỷ 20,&amp;nbsp;plimsolls thậm ch&amp;iacute; được ph&amp;aacute;t hiện c&amp;ugrave;ng với x&amp;aacute;c của đo&amp;agrave;n leo n&amp;uacute;i&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;th&amp;aacute;m hiểm Terra Nova&lt;/a&gt;&amp;nbsp;xấu số. Plimsolls thậm ch&amp;iacute; cũng l&amp;agrave; một loại gi&amp;agrave;y bắt buộc trong c&amp;aacute;c tiết học&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thể dục&lt;/a&gt;&amp;nbsp;của nước Anh.[&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;cần dẫn nguồn&lt;/a&gt;]&lt;/p&gt;\r\n\r\n&lt;p&gt;C&amp;ocirc;ng ty gi&amp;agrave;y&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;J.W. Foster and Sons&lt;/a&gt;&amp;nbsp;của anh bắt đầu sản xuất mẫu gi&amp;agrave;y chạy bộ đầu ti&amp;ecirc;n v&amp;agrave;o năm 1895; đ&amp;ocirc;i gi&amp;agrave;y c&amp;oacute; lớp gai ở đế để gi&amp;uacute;p thuận lợi hơn cho việc gia tăng sức bền v&amp;agrave; tốc độ. C&amp;ocirc;ng ty sau đ&amp;oacute; b&amp;aacute;n ra những mẫu gi&amp;agrave;y handmade chất lượng cao tới c&amp;aacute;c vận động vi&amp;ecirc;n điền kinh tr&amp;ecirc;n khắp thế giới, v&amp;agrave; cuối c&amp;ugrave;ng nhận được một hợp đồng sản xuất gi&amp;agrave;y của đội tuyển Anh tham dự&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thế vận hội m&amp;ugrave;a h&amp;egrave; Olympic 1924&lt;/a&gt;.&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Harold Abrahams&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Eric Liddell&lt;/a&gt;&amp;nbsp;đ&amp;atilde; chiến thắng trong phần thi chạy 100m v&amp;agrave; 400m, sử dụng những đ&amp;ocirc;i gi&amp;agrave;y của nh&amp;agrave; Foster.&lt;a href=&quot;\\&quot;&gt;[8]&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Một đ&amp;ocirc;i gi&amp;agrave;y điền kinh m&amp;agrave;u trắng với hoạ tiết hồng của&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Nike&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;C&amp;ograve;n tại Mỹ, thiết kế của gi&amp;agrave;y d&amp;eacute;p dần trở n&amp;ecirc;n đ&amp;aacute;ng ch&amp;uacute; &amp;yacute; hơn ở cuối của thế kỷ 20, l&amp;uacute;c n&amp;agrave;y ch&amp;uacute;ng được gọi l&amp;agrave; &amp;quot;sneakers&amp;quot;. V&amp;agrave;o năm 1892, C&amp;ocirc;ng ty&amp;nbsp;U.S. Rubber&amp;nbsp;giới thiệu mẫu gi&amp;agrave;y đế cao su đầu ti&amp;ecirc;n trong nước, trở n&amp;ecirc;n nổi như cồn v&amp;agrave; li&amp;ecirc;n tục ch&amp;aacute;y h&amp;agrave;ng. Đ&amp;ocirc;i gi&amp;agrave;y b&amp;oacute;ng rổ đầu ti&amp;ecirc;n được thiết kế bởi&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Spalding&lt;/a&gt;&amp;nbsp;v&amp;agrave;o đầu năm 1907. Thị trường gi&amp;agrave;y sneaker tiếp tục ph&amp;aacute;t triển sau&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Thế chiến thứ nhất&lt;/a&gt;, khi thể thao v&amp;agrave; điền kinh dần trở th&amp;agrave;nh một c&amp;aacute;ch để t&amp;ocirc;n vinh tinh thần v&amp;agrave; l&amp;ograve;ng y&amp;ecirc;u nước. Thị trường sneaker tại Mỹ gia tăng nhanh ch&amp;oacute;ng khi c&amp;aacute;c cậu thiếu ni&amp;ecirc;n bắt đầu mua sneaker v&amp;igrave; thần tượng của ch&amp;uacute;ng, cầu thủ b&amp;oacute;ng đ&amp;aacute;&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Jim Thorpe&lt;/a&gt;, b&amp;ecirc;n cạnh đ&amp;oacute; l&amp;agrave; mẫu gi&amp;agrave;y&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Converse All Stars&lt;/a&gt;&amp;nbsp;được quảng c&amp;aacute;o bởi v&amp;acirc;n động vi&amp;ecirc;n b&amp;oacute;ng rổ&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Chuck Taylor&lt;/a&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;giai đoạn giữa hai cuộc chiến tranh&lt;/a&gt;, gi&amp;agrave;y thể thao cũng dần được quảng b&amp;aacute; ở c&amp;aacute;c m&amp;ocirc;n thể thao kh&amp;aacute;c, c&amp;aacute;c thiết kế kh&amp;aacute;c nhau được sử dụng cho cả nam v&amp;agrave; nữ. Gi&amp;agrave;y điền kinh l&amp;uacute;c n&amp;agrave;y được vận động vi&amp;ecirc;n sử dụng để tranh đấu tại&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Olympics&lt;/a&gt;, gi&amp;uacute;p phổ biến h&amp;igrave;nh ảnh gi&amp;agrave;y điền kinh tới to&amp;agrave;n thể c&amp;ocirc;ng ch&amp;uacute;ng. V&amp;agrave;o năm 1936, một nh&amp;atilde;n hiệu của Ph&amp;aacute;p, Spring Court,&lt;a href=&quot;\\&quot;&gt;[9]&lt;/a&gt;&amp;nbsp;đ&amp;atilde; quảng b&amp;aacute; đ&amp;ocirc;i gi&amp;agrave;y tennis đầu ti&amp;ecirc;n l&amp;agrave;m từ chất liệu vải canvas với đế cao su tự nhi&amp;ecirc;n.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Adolf &amp;quot;Adi&amp;quot; Dassler&lt;/a&gt;&amp;nbsp;bắt đầu sản xuất đ&amp;ocirc;i gi&amp;agrave;y thể thao đầu ti&amp;ecirc;n của ri&amp;ecirc;ng m&amp;igrave;nh trong ph&amp;ograve;ng bếp của mẹ &amp;ocirc;ng ở&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Herzogenaurach&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Bavaria&lt;/a&gt;&amp;nbsp;sau khi trở về từ&amp;nbsp;Thế chiến thứ nhất, rồi sau đ&amp;oacute; &amp;ocirc;ng đ&amp;atilde; tiến h&amp;agrave;nh khai trương một cơ sở sản xuất gi&amp;agrave;y m&amp;agrave; về sau trở th&amp;agrave;nh một thương hiệu thể thao to&amp;agrave;n cầu,&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Adidas&lt;/a&gt;.&lt;a href=&quot;\\&quot;&gt;[10]&lt;/a&gt;&amp;nbsp;&amp;Ocirc;ng rất th&amp;agrave;nh c&amp;ocirc;ng trong việc quảng b&amp;aacute; đ&amp;ocirc;i gi&amp;agrave;y của m&amp;igrave;nh tới c&amp;aacute;c vận động vi&amp;ecirc;n điền kinh trong&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thế vận hội m&amp;ugrave;a h&amp;egrave; 1936&lt;/a&gt;, điều n&amp;agrave;y gi&amp;uacute;p sản phẩm của c&amp;ocirc;ng ty &amp;ocirc;ng trở n&amp;ecirc;n phổ biến hơn với c&amp;ocirc;ng ch&amp;uacute;ng. Dần dần, việc kinh doanh trở n&amp;ecirc;n ph&amp;aacute;t đạt v&amp;agrave;&amp;nbsp;Dasslers đ&amp;atilde; b&amp;aacute;n được 200.000 đ&amp;ocirc;i gi&amp;agrave;y mỗi năm trước&amp;nbsp;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;chiến tranh thế giới thứ hai&lt;/a&gt;.&lt;a href=&quot;\\&quot;&gt;[11]&lt;/a&gt;&lt;/p&gt;\r\n', '&lt;p&gt;About us desc&lt;/p&gt;\r\n', '&lt;p&gt;Giới thiệu m&amp;ocirc; tả&lt;/p&gt;\r\n', 'About us', 'Giới thiệu', 'https://www.youtube.com/watch?v=uda4oqUroHA', '18318_taptin.rar', 'gioi-thieu', 1),
